INSERT INTO `course` VALUES (1, '385', '101', '100385101', 'Rust 编程零基础班', '2', 1, 3, 'https://ssl.cdn.maodouketang.com/FnM7WlxJBzRvwot2Uti0D-WS-4Kd', NULL, NULL, '北京', '{\"title\":\"企业展示区\",\"desc\":\"深圳北鲲云计算有限公司是一家专注于为有高算力需求的用户提供一站式Cloud-HPC产品和服务的高新技术企业。北鲲云拥有全球领先的Cloud-HPC SaaS平台，核心成员来自于Oracle、爱立信、IBM、华为等国际知名企业，拥有丰富的研发和企业服务管理经验。\",\"qrcodeTitle\":\"北鲲云计算诚招 Rust开发工程师<br/>20-40K*16薪（坐标深圳）\",\"qrcodeTitleLink\":\"https://www.lagou.com/wn/jobs/9922919.html\",\"qrcodeURL\":\"https://maodou-courseware-1257797626.cos.ap-beijing.myqcloud.com/origin/100041120/rust_qrcode.png\", \"mainScreenBgUrl\":\"https://ssl.cdn.maodouketang.com/FiVqNglvbzAQC3ecLMKCFx3wcQ4i\",\"mainScreenQrUrl\":\"https://rust.os2edu.cn/\"}', '4', '0', 'hot', NULL, '2022-11-08 10:01:28', '2022-11-08 10:01:28', 1, 1, '0', 240, NULL, '为使用Rust编程开发操作系统内核打下坚实的基础', NULL, '<h2>课程主页链接：</h2><p><a href=\"https://github.com/os2edu/rust-basics-course\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\">https://github.com/os2edu/rust-basics-course</a></p><p><br></p><h2>学习文档链接：</h2><p><a href=\"http://docs.os2edu.cn/\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\">http://docs.os2edu.cn/</a></p><p><br></p><h2>学习小组公约：</h2><p><span class=\"ql-size-large\">为了Rust学习小组能够有效、长久的开展下去，并使每位成员都能从中受益，特制定Rust学习小组公约如下：</span></p><p><span class=\"ql-size-large\">1. 每周三和周六的晚上8点开始，定为固定时间的小组讨论会。如有需要调整时间，可以顺延到周四和周日晚上。每次讨论会不少于1小时，不多于3小时。</span></p><p><span class=\"ql-size-large\">2. 第一期从2022.2.14开始，学习周期初步定为3周，学习目标是完成陈渝老师给出的教材/练习/实验/参考书，总结出rust基础班学习的课程知识点大纲和时间进度安排表。</span></p><p><span class=\"ql-size-large\">3. 基于 mkdocs 搭建教材编写的协作平台，学习小组将共同基于 https://github.com/os2edu 和 http://docs.os2edu.cn 来完善rust基础班学习知识体系。</span></p><p><span class=\"ql-size-large\">4. 每个小组成员要求每周的学习都要有所输出，每周2次讨论会无故不缺席，并至少进行一次分享，学习周期内每个人不少于三次分享，每次时间以10-20分钟为宜。</span></p><p><span class=\"ql-size-large\">5. 输出的重点，不在数量，而在质量。输出的形式可以是自己参与编写的文档部分，提炼成的PPT，开发调试的代码，精心绘制的思维导图等原创材料都可以作为分享的内容。</span></p><p><span class=\"ql-size-large\">6. 小组协作学习的核心，三个字：“输带化” -- 强制输出带动吸收内化。在学习小组内，一不等二不靠老师来教，一切靠自主探究去解决。</span></p><p><br></p><h2>教材</h2><ul><li><a href=\"https://www.oreilly.com/library/view/programming-rust-2nd/9781492052586/\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\" style=\"color: var(--color-accent-fg);\">Programming Rust v2, 简称PR</a></li><li><a href=\"https://gitee.com/chyyuu/command-line-rust\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\" style=\"color: var(--color-accent-fg);\">Command Line Rust, 简称CLR</a></li></ul><h2><br></h2><h2>练习</h2><ul><li><a href=\"https://rust-by-example.budshome.com/\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\" style=\"color: var(--color-accent-fg);\">通过例子学 Rust</a></li><li><a href=\"https://github.com/rust-lang/rustlings\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\" style=\"color: var(--color-accent-fg);\">rustlings</a></li></ul><h2><br></h2><h2>实验</h2><ul><li><a href=\"https://github.com/kyclark/command-line-rust\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\" style=\"color: var(--color-accent-fg);\">labs from CLR</a></li></ul><h2><br></h2><h2>参考书</h2><ul><li><a href=\"https://kaisery.github.io/trpl-zh-cn/\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\" style=\"color: var(--color-accent-fg);\">Rust 程序设计语言</a></li><li><a href=\"https://course.rs/\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\" style=\"color: var(--color-accent-fg);\">Rust语言圣经(Rust教程 Rust Course)</a></li></ul><h2><br></h2><h2>相关学习资源</h2><ul><li><a href=\"https://github.com/rcore-os/rCore/wiki/study-resource-of-system-programming-in-RUST\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\" style=\"color: var(--color-accent-fg);\">用RUST进行系统编程的自学资源</a></li></ul>', NULL, NULL);
INSERT INTO `course` VALUES (2, '385', '102', '100385102', 'Rust编程语言强化训练班', '2', 1, 3, 'https://ssl.cdn.maodouketang.com/FnDocVSzq_KL5kzpWs1ltDgpyvhb', NULL, NULL, '北京', '{\"title\":\"企业展示区\",\"desc\":\"“神龙X-Dragon架构”是阿里云自研的软硬件一体化计算架构，深度融合了物理机和虚拟机特性，可兼顾虚拟机的弹性资源、分钟级交付、全自动运维和物理机的性能优势、完整特性和硬件级隔离，为用户了提供一种新型的计算资源交付方式。\",\"qrcodeTitle\":\"正在招聘虚拟化rust vmm研发专家<br/>工作地点：北京/杭州\",\"qrcodeTitleLink\":\"https://jobs.zhaopin.com/CC000127910J40230118815.htm?refcode=4019&srccode=401903&preactionid=ae42f1ab-b50d-48f4-aa2d-4559309eb814\",\"qrcodeURL\":\"https://maodou-courseware-1257797626.cos.ap-beijing.myqcloud.com/origin/100041120/ant_rust.png\",\"mainScreenBgUrl\":\"https://ssl.cdn.maodouketang.com/FiVqNglvbzAQC3ecLMKCFx3wcQ4i\",\"mainScreenQrUrl\":\"https://rust.os2edu.cn/\"}', '4', '0', 'hot', NULL, '2022-11-08 10:01:28', '2022-11-08 10:01:28', 1, 2, '0', 240, NULL, '通过Rustlings配套练习，强化训练Rust编程语言（教材TRPL）编码开发', NULL, '<p><span class=\"ql-size-large\">Rust编程语言强化训练班，是通过Rustlings配套练习，强化训练Rust编程语言（教材TRPL）编码开发。</span></p><p><br></p><p><strong class=\"ql-size-large\">学习教材 TRPL</strong></p><p><a href=\"https://kaisery.github.io/trpl-zh-cn/\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\">https://kaisery.github.io/trpl-zh-cn/</a></p><p><br></p><p><strong class=\"ql-size-large\">配套练习 Rustlings</strong></p><p><a href=\"https://github.com/rust-lang/rustlings\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\">https://github.com/rust-lang/rustlings</a></p><p><br></p><p><strong class=\"ql-size-large\">学习进度安排表</strong></p><p><a href=\"https://github.com/os2edu/rust-basics-course/blob/main/schedule.md\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\">https://github.com/os2edu/rust-basics-course/blob/main/schedule.md</a></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong class=\"ql-size-large\">学习目标和要求：</strong></p><p><span class=\"ql-size-large\">1. 完成全部20个教材章节的理论学习</span></p><p><span class=\"ql-size-large\">2. 完成rustlings上的配套练习题编程</span></p><p><span class=\"ql-size-large\">3. 三周累计学习时长不少于21小时（平均每晚不少于1小时）</span></p><p><br></p><p><br></p><p><strong class=\"ql-size-large\">学习小组公约：</strong></p><p><span class=\"ql-size-large\">1. 每周二，四，日的晚上8点，是2期学习小组例常的讨论会时间，没有特殊情况要求都能参加。</span></p><p><span class=\"ql-size-large\">2. 在完成对应章节的理论知识学习后，需要完成配套rustlings的编程练习，小组讨论会将侧重知识的答疑解惑和所写的代码演示。</span></p><p><span class=\"ql-size-large\">3. 周二晚上侧重1-6章，周四晚上侧重7-12张，周日晚上侧重13-20章。</span></p>', NULL, NULL);
INSERT INTO `course` VALUES (3, '385', '103', '100385103', 'rCore学习小组分享会', '2', 1, 3, 'https://ssl.cdn.maodouketang.com/FhTOuy0cVo1TY0K91A_ySRa5x4SN', NULL, NULL, '北京', '{\"title\":\"rCore布道者征集中\",\"desc\":\"rCore是清华大学教学操作系统 uCore 的Rust移植版本，致力于使用现代编程语言，提升OS的开发体验和质量，探索未来OS的设计实现方式。如果您已经开始或即将学习rCore，欢迎您加入到rCore学习小组进行分享交流，并成为rCore开源操作系统的布道者。(联系微信：limingth)\",\"qrcodeTitle\":\"2022全国大学生计算机系统<br/>能力大赛操作系统设计大赛\",\"qrcodeTitleLink\":\"https://os.educg.net/\",\"qrcodeURL\":\"https://maodou-courseware-1257797626.cos.ap-beijing.myqcloud.com/origin/100385103/rCore.png\", \"mainScreenBgUrl\":\"\",\"mainScreenQrUrl\":\"\"}', '4', '0', 'hot', NULL, '2022-11-01 10:41:06', '2022-11-01 10:41:06', 1, 3, '0', 240, NULL, '如何从零开始用 Rust 语言写一个OS。 学习小组分享会不定期开展线上技术分享讲座，邀请牛人交流技术心得', NULL, '<h1>基于Rust语言的操作系统实验课程</h1><h2><br></h2><h2><span class=\"ql-size-large\">教材</span></h2><ul><li><a href=\"https://rcore-os.github.io/rCore-Tutorial-Book-v3/\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\" style=\"color: var(--color-accent-fg);\">rCore Tutorial Book v3</a></li></ul><h2><br></h2><h2><span class=\"ql-size-large\">实验</span></h2><ul><li><a href=\"https://github.com/rcore-os/rCore-Tutorial-v3\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\" style=\"color: var(--color-accent-fg);\">rCore Tutorial v3</a></li></ul><h2><br></h2><h2><span class=\"ql-size-large\">OS参考书</span></h2><ul><li><a href=\"https://pages.cs.wisc.edu/~remzi/OSTEP/Chinese/\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\" style=\"color: var(--color-accent-fg);\">Operating Systems: Three Easy Pieces 中文版</a></li></ul><h2><br></h2><h2><span class=\"ql-size-large\">OS in Rust 资源</span></h2><ul><li><a href=\"https://github.com/chyyuu/aos_course_info/blob/master/oslist.md\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\" style=\"color: var(--color-accent-fg);\">基于Rust的OS/Hypervisor/VMM...</a></li></ul><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><h2><span class=\"ql-size-large\">课程相关信息</span></h2><p><br></p><p><strong class=\"ql-size-large\">课程主页：</strong></p><p><a href=\"https://github.com/os2edu/os-labs-in-rust-course\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\">https://github.com/os2edu/os-labs-in-rust-course</a></p><p><br></p><p><strong class=\"ql-size-large\">OS in Rust 的教材：</strong></p><p><a href=\"https://rcore-os.github.io/rCore-Tutorial-Book-v3/\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\">https://rcore-os.github.io/rCore-Tutorial-Book-v3/</a></p><p><br></p><p><strong class=\"ql-size-large\">OS in Rust 的实验：</strong></p><p><a href=\"https://github.com/rcore-os/rCore-Tutorial-v3\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\">https://github.com/rcore-os/rCore-Tutorial-v3</a></p><p><br></p><p><strong class=\"ql-size-large\">OS in Rust 的大纲：</strong></p><p><a href=\"https://github.com/LearningOS/os-lectures/blob/master/os-course-outline.md\" rel=\"noopener noreferrer\" target=\"_blank\" class=\"ql-size-large\">https://github.com/LearningOS/os-lectures/blob/master/os-course-outline.md</a></p>', NULL, NULL);
INSERT INTO `course` VALUES (4, '385', '104', '112233444', 'Java', NULL, NULL, NULL, 'https://ssl.cdn.maodouketang.com/Fm38SCcfOzmERpsSK98sALd2UHbg', '', NULL, NULL, NULL, NULL, '1', 'notHot', NULL, '2022-11-11 17:46:37', '2022-11-11 17:46:37', 1, 2, '1', 0, NULL, 'Java开发', NULL, NULL, NULL, NULL);
INSERT INTO `course` VALUES (5, '466', '104', '100466104', '龙芯师资培训班', NULL, NULL, NULL, 'https://ssl.cdn.maodouketang.com/FnJQwzwUmpq70SEKzJbD88XRoAFP', '高', NULL, NULL, NULL, NULL, '0', 'hot', NULL, '2022-11-15 11:56:44', '2022-11-15 11:56:44', 1, 0, NULL, 0, NULL, '课程由龙芯中科一线研发专家、信息技术应用创新领军企业特约技术专家联合讲授。学员完成培训并通过考核，可获得由工信部颁发的信创专业人才证书。', NULL, '<p><strong>一、组织单位</strong></p><p>主办单位：龙芯中科技术股份有限公司</p><p>承办单位：工学宝（北京）教育科技有限公司</p><p><br></p><p><strong>二、面向群体</strong></p><p>1.&nbsp;本次培训面向全国本科、高职、中职院校相关二级学院领导、专业负责人等。</p><p>2.&nbsp;有意提升专业课能力，对信创领域的产教融合感兴趣的计算机相关专业老师。</p><p>3.&nbsp;其他有意进入信息技术应用创新领域，或希望系统学习龙芯架构知识的人员。</p><p><br></p><p><strong>三、课程亮点</strong></p><p>1.&nbsp;实战化教学方案。课程为每位学员配备“龙芯云实训环境”，同步提供实训手册、实训案例及实训指导。</p><p>2.&nbsp;专业化授课团队。课程由龙芯中科一线研发专家、信息技术应用创新领军企业特约技术专家联合讲授。</p><p>3.&nbsp;权威性人才证书。学员完成培训并通过考核，可获得由XXX颁发的信创专业人才证书。</p><p>4.&nbsp;参与双师培训的老师将有机会获得基于龙架构的教材研发合作、人工智能相关的横向课题合作。</p><p><br></p><p><strong>四、课程安排</strong></p><p><strong>第一天</strong></p><p>上午 信创主题报告</p><p>1、相关领导致辞</p><p>2、龙芯CPU技术及生态体系</p><p>3、龙芯信创产教融合解决方案</p><p>4、龙架构方向信创实训开发课程介绍</p><p>下午 面向龙架构平台的Web应用迁移适配</p><p>1、Web开发/React框架应用技术架构</p><p>2、Web应用迁移适配（上机实践）</p><p>3、龙芯前端开发调试实操（上机实践）</p><p><br></p><p><strong>第二天</strong></p><p>上午 Java微服务架构及开发培训</p><p>1、SpringBoot微服务及API接口设计</p><p>2、MySQL 数据库配置和表结构设计</p><p>3、SpringCloud 微服务架构介绍</p><p>下午 面向龙架构平台的Java/SpringBoot应用迁移适配</p><p>1、Java/Spring 开发环境搭建（上机实践）</p><p>2、MySQL 数据库安装/配置实操（上机实践）</p><p>3、SpringBoot 开发实操（上机实践）</p><p>4、Eureka 服务注册中心实操（上机实践）</p><p><br></p><p><strong>第三天</strong></p><p>上午 面向龙架构平台的Python程序设计与开发实践</p><p>1、Python 理论基础</p><p>2、控制语句，模块编写，类和函数</p><p>3、Python 网络编程（Server &amp; Client）</p><p>下午 龙架构Python应用开发案例</p><p>1、Python Excel 表格编程（上机实践）</p><p>2、日常办公系统自动化（上机实践）</p><p>3、Python 网络编程实操（上机实践）</p><p><br></p><p><strong>第四天</strong></p><p>上午 龙架构Python爬虫开发案例</p><p>1、Python 爬虫开发框架</p><p>2、无头浏览器数据抓取实战（上机实践）</p><p>3、爬虫结果报表展示实战（上机实践）</p><p>下午 龙芯答疑、交流与合作研讨会</p><p>1、课程问题解疑</p><p>2、龙芯技术未来发展趋势交流</p><p>3、龙芯产教、课程研发、产业项目合作交流</p><p><br></p><p><strong>五、邀请专家</strong></p><p>付老师：</p><p>工学宝新工科Web微服务技术架构师，北京邮电大学通信工程硕士。11年互联网、SaaS云平台、大数据、Devops行业领域经验，其中8年技术架构、解决方案、项目及团队管理经验。曾任阿里巴巴、某大型央企架构师及技术负责人。主导数据中台建设，构建层次化数仓及主题域，统筹技术规范、开发框架、敏捷管理，结合云原生、容器、低代码技术实现平台灵活扩展，并以敏捷开发模式推进迭代开发持续交付。</p><p><br></p><p>何老师：</p><p class=\\\"ql-align-justify\\\">工学宝新工科技术总监，金牌讲师，拥有15年系统程序开发经验，10年IT行业教学经验，10年以上Linux驱动开发经验。曾任职于AMD，亚嵌教育，智普教育，中信集团，爱音斯坦等多家公司技术总监等职务。现任职于龙芯IC部软件技术负责人。精通C语言，python，龙芯汇编，主导多项开源项目有requests，Klang，libp2p-examples等，发起Python编程公园等公益项目。</p><p><br></p><p><strong>六、专业证书</strong></p><p>龙芯自2018年着手开展培训，至今已成功举办培训活动100余场，培养学员<strong style=\\\"color: rgb(192, 0, 0);\\\">10W+</strong>。</p><p>随着人才培养需求的逐步升级，龙芯加强建设培训合作，与<strong style=\\\"color: rgb(192, 0, 0);\\\">工信部人才交流中心</strong>共同为学员颁发证书；与全国各区域企业、院校共建“龙芯生态信创人才培养基地”，共同探索人才培养新模式。</p><p><br></p><p><img src=\\\"https://ssl.cdn.maodouketang.com/FkfEfiYBuCSaax1Tzb-3QLBNG3mT\\\"></p>', 'https://loongsonedu.maodouketang.com/pages/course?id=104', NULL);
INSERT INTO `course` VALUES (6, '466', '105', NULL, 'Python 程序设计与开发实践案例', NULL, NULL, NULL, 'https://ssl.cdn.maodouketang.com/Fp5X3GjwK0Rnd5uDiJ2hBahaLUDJ', NULL, NULL, NULL, NULL, NULL, '0', 'hot', NULL, '2022-11-15 14:47:38', '2022-11-15 14:47:38', 1, 0, NULL, 0, NULL, '面向龙架构平台的 Python 程序设计与开发实践案例', NULL, '<p>面向龙架构平台的 Python 程序设计与开发实践案例</p><p><img src=\\\"data:image/png;base64,\\\"></p>', 'https://loongsonedu.maodouketang.com/pages/course?id=105', NULL);
INSERT INTO `course` VALUES (7, '466', '106', NULL, 'JAVA 程序设计与开发实践案例', NULL, NULL, NULL, 'https://ssl.cdn.maodouketang.com/FqjCMpbW0R-ulcUPyO_2pulkxGMI', NULL, NULL, NULL, NULL, NULL, '0', 'hot', NULL, '2022-11-15 14:47:39', '2022-11-15 14:47:39', 1, 0, NULL, 0, NULL, '面向龙架构平台的 JAVA 程序设计与开发实践案例', NULL, '<p>面向龙架构平台的 JAVA 程序设计与开发实践案例</p><p><br></p><p><img src=\\\"data:image/png;base64,\\\"></p>', 'https://loongsonedu.maodouketang.com/pages/course?id=106', NULL);
INSERT INTO `course` VALUES (8, '466', '101', NULL, 'Loongson龙芯处理器', NULL, NULL, NULL, 'https://ssl.cdn.maodouketang.com/FjkN1neQkwxQO-Fk3TnZNAr3_8B6', NULL, NULL, NULL, NULL, NULL, '0', 'hot', NULL, '2022-11-15 14:47:41', '2022-11-15 14:47:41', 1, 0, NULL, 0, NULL, '龙芯一号、龙芯二号、龙芯三号分别面向嵌入式专门应用、工控和终端类应用和桌面/服务器类应用', NULL, '<h3><span class=\\\"ql-size-large\\\">Loongson龙芯处理器</span></h3><h4><span class=\\\"ql-size-large\\\">龙芯一号：面向嵌入式专门应用</span></h4><ul><li><span class=\\\"ql-size-large\\\">龙芯1H - 面向钻井应用的耐高温芯片</span></li><li><span class=\\\"ql-size-large\\\">龙芯1D - 面向超声波热表、水表和气表测量的低功耗、低成本专用处理器</span></li><li><span class=\\\"ql-size-large\\\">龙芯1C101 - 龙芯1C101是在龙芯1C100基础上针对门锁应用而优化设计的单片机芯片</span></li><li><span class=\\\"ql-size-large\\\">龙芯1C - 面向工业控制及物联网等领域的高性价比SOC芯片</span></li><li><span class=\\\"ql-size-large\\\">龙芯1B - 一款面向嵌入式专用应用领域的轻量级的32位SoC芯片</span></li><li><span class=\\\"ql-size-large\\\">龙芯1A - 面向嵌入式专用应用领域的低功耗、低成本处理器</span></li></ul><h4><span class=\\\"ql-size-large\\\">龙芯二号：面向工控和终端类应用</span></h4><ul><li><span class=\\\"ql-size-large\\\">龙芯2K1000 - 面向工业控制与终端等领域的低功耗通用处理器</span></li><li><span class=\\\"ql-size-large\\\">龙芯2K0500 - 面向工控互联网应用、打印终端、BMC等应用场景高集成度处理器芯片</span></li></ul><h4><span class=\\\"ql-size-large\\\">龙芯三号：面向桌面/服务器类应用</span></h4><ul><li><span class=\\\"ql-size-large\\\">龙芯3A5000/3B5000 - 面向个人计算机、服务器等信息化领域的通用处理器</span></li><li><span class=\\\"ql-size-large\\\">龙芯3C5000L - 龙芯中科专门面向服务器领域的通用处理器</span></li><li><span class=\\\"ql-size-large\\\">龙芯3A4000/3B4000 - 面向个人计算机、服务器等信息化领域的通用处理器</span></li></ul>', 'https://loongsonedu.maodouketang.com/pages/course?id=101', NULL);
INSERT INTO `course` VALUES (9, '466', '102', NULL, 'LoongArch龙芯架构', NULL, NULL, NULL, 'https://ssl.cdn.maodouketang.com/FvHSbNYTDOPOeaIfKF1wdebUIv0y', NULL, NULL, NULL, NULL, NULL, '0', 'hot', NULL, '2022-11-15 14:47:42', '2022-11-15 14:47:42', 1, 0, NULL, 0, NULL, '充分考虑兼容需求的龙芯指令系统LoongArch®，核心IP自主掌握，龙芯安全程度最高', NULL, '<h3><span class=\\\"ql-size-large\\\">LoongArch龙芯架构</span></h3><h4><span class=\\\"ql-size-large\\\">充分考虑兼容需求的龙芯指令系统LoongArch®</span></h4><ul><li><span class=\\\"ql-size-large\\\">2020年，龙芯中科基于二十年的CPU研制和生态建设积累推出了龙芯指令系统（LoongArch®），包括基础架构部分和向量指令、虚拟化、二进制翻译等扩展部分，近2000条指令。</span></li><li><span class=\\\"ql-size-large\\\">龙芯指令系统具有较好的自主性、先进性与兼容性。龙芯指令系统从整个架构的顶层规划，到各部分的功能定义，再到细节上每条指令的编码、名称、含义，在架构上进行自主重新设计，具有充分的自主性。</span></li><li><span class=\\\"ql-size-large\\\">龙芯指令系统在设计时充分考虑兼容生态需求，融合了各国际主流指令系统的主要功能特性，同时依托龙芯团队在二进制翻译方面十余年的技术积累创新，能够实现多种国际主流指令系统的高效二进制翻译。龙芯中科从2020年起新研的CPU均支持LoongArch®。</span></li></ul><h4><span class=\\\"ql-size-large\\\">核心IP自主掌握，龙芯安全程度最高</span></h4><ul><li><span class=\\\"ql-size-large\\\">高速接口 - HT控制器和PHY，PCIE4.0控制器和PHY</span></li><li><span class=\\\"ql-size-large\\\">片内互联总线 - AXI,AHB,APB；XBAR、RING、互联总线</span></li><li><span class=\\\"ql-size-large\\\">内存控制器 - SDRAM、DDR2、DDR3、DDR4</span></li><li><span class=\\\"ql-size-large\\\">打通各类接口</span></li><li class=\\\"ql-indent-1\\\"><span class=\\\"ql-size-large\\\">存储接口：SPI,SDIO,NANDFlash,NORFlash；</span></li><li class=\\\"ql-indent-1\\\"><span class=\\\"ql-size-large\\\">音视频接口：HDA,AC97,I2S,LCD,HDMI；</span></li><li class=\\\"ql-indent-1\\\"><span class=\\\"ql-size-large\\\">工业接口：UART,I2C,PWM,CAN,LIO,LPC,TSENSOR,VPWM,RTC,ACPI,ADC，1553B,SpaceWire,PPC,PCM,OC，JBIG,LSU；</span></li><li><span class=\\\"ql-size-large\\\">已掌握2D/3DGPU技术</span></li><li><span class=\\\"ql-size-large\\\">全国产桥片方案7A1000、7A2000</span></li><li><span class=\\\"ql-size-large\\\">多种定制模块多端口寄存器堆、PLL、DDR2/3/4-PHY、HT-PHY</span></li></ul>', 'https://loongsonedu.maodouketang.com/pages/course?id=102', NULL);
INSERT INTO `course` VALUES (10, '466', '103', NULL, 'Loongnix基础版操作系统', NULL, NULL, NULL, 'https://ssl.cdn.maodouketang.com/FnHFCRQDveEjBwtZ6UBezmmOH_OJ', NULL, NULL, NULL, NULL, NULL, '0', 'hot', NULL, '2022-11-15 14:48:57', '2022-11-15 14:48:57', 1, 0, NULL, 0, NULL, 'Loongnix-Server/Client/Cloud 分别面向服务器、个人计算机和云计算，Loongnix掌握操作系统核心技术，内置基础软件', NULL, '<h3><span class=\\\"ql-size-large\\\">Loongnix基础版操作系统</span></h3><ul><li><span class=\\\"ql-size-large\\\">Loongnix-Server 面向服务器</span></li><li><span class=\\\"ql-size-large\\\">Loongnix-Client 面向个人计算机</span></li><li><span class=\\\"ql-size-large\\\">Loongnix-Cloud，面向云计算</span></li></ul><h4><span class=\\\"ql-size-large\\\">Loongnix掌握操作系统核心技术</span></h4><ul><li><span class=\\\"ql-size-large\\\">Linux内核</span></li><li><span class=\\\"ql-size-large\\\">GCC、LLVM、GOLANG</span></li><li><span class=\\\"ql-size-large\\\">Java虚拟机</span></li><li><span class=\\\"ql-size-large\\\">.NET</span></li><li><span class=\\\"ql-size-large\\\">浏览器</span></li><li><span class=\\\"ql-size-large\\\">媒体播放器</span></li></ul><h4><span class=\\\"ql-size-large\\\">Loongnix内置基础软件</span></h4><ul><li><span class=\\\"ql-size-large\\\">内核：基于社区长期维护版(LTS)的龙芯产品化版</span></li><li><span class=\\\"ql-size-large\\\">操作系统基础库：文件系统、包管理系统、安全与审计、基础图形图像库</span></li><li><span class=\\\"ql-size-large\\\">固件支持：支持ACPI标准,兼容支持PMON、昆仑、百敖及UEFI，自适应提供各种固件所需要的启动文件</span></li><li><span class=\\\"ql-size-large\\\">云计算：OpenStack、Docker、KVM、oVirt、Libvirt、Virtmanager等</span></li><li><span class=\\\"ql-size-large\\\">编译工具：GCC，Binutils，LLVM，Rust、Golang等主流编译器</span></li><li><span class=\\\"ql-size-large\\\">内置浏览器：支持Html5、WebAssembly、NPAPI、CSS等技术，支持国密算法、办公插件</span></li><li><span class=\\\"ql-size-large\\\">编程语言：C/C++、C#，Fortran，Java、JavaScript、XML、Python、Ruby、Php、Perl等</span></li><li><span class=\\\"ql-size-large\\\">基础媒体应用：VLC，Smplayer，Flameshot，Openshot，OpenCV等</span></li><li><span class=\\\"ql-size-large\\\">API基础环境：JAVA、.Net、Node.js、Qt、Electron、CEF、VS-Code、Eclipse等</span></li></ul>', 'https://loongsonedu.maodouketang.com/pages/course?id=103', NULL);

-- ----------------------------
-- Table structure for course_class
-- ----------------------------
DROP TABLE IF EXISTS `course_class`;
CREATE TABLE `course_class`  (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `client_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '机构ID',
  `course_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `jhi_type` int NULL DEFAULT NULL,
  `class_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `cover_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '老师姓名',
  `teacher` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `assistant` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `start_at` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `end_at` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `location` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `class_info` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `enroll_count` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `buyers_count` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '老师简介',
  `view_count` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '老师简介',
  `price` int NULL DEFAULT NULL COMMENT '老师简介',
  `jhi_number` int NULL DEFAULT NULL COMMENT '期数',
  `tag` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `course_class_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `status` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `created_at` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `updated_at` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `room_id` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'roomid',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `review_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '回放url',
  `chose_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '点播url',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of course_class
-- ----------------------------

-- ----------------------------
-- Table structure for gen_table
-- ----------------------------
DROP TABLE IF EXISTS `gen_table`;
CREATE TABLE `gen_table`  (
  `table_id` bigint NOT NULL AUTO_INCREMENT COMMENT '编号',
  `table_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '表名称',
  `table_comment` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '表描述',
  `sub_table_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '关联子表的表名',
  `sub_table_fk_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '子表关联的外键名',
  `class_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '实体类名称',
  `tpl_category` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT 'crud' COMMENT '使用的模板（crud单表操作 tree树表操作）',
  `package_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '生成包路径',
  `module_name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '生成模块名',
