INSERT INTO `homepage` VALUES (378, '466', NULL, 'https://ssl.cdn.maodouketang.com/Fui0_IPW7ITa23HZ9IeoRm9rCvqT', NULL, NULL, '2019年11月15日,龙芯教育品牌正式发布。龙芯中科联合国内相关计算机科研与教育单位，以提高我国计算机基础软硬件领域的教学与应用水平为目标，立足国产“龙芯\"CPU的开放平台，配合教育部高等学校计算类专业教学指导委员会以“在高校计算类专业中推动系统能力培养为目标”进行计算机专业课程改革。同时，龙芯开发了系列化教学实验系统与平台，弥补我国在系统能力培养教学方面缺乏实验教学仪器的不足，并进行了上述课程的配套实验开发。\n龙芯教育的目标是不仅仅要培养“用”计算机的人才，更要培养“造”计算机的人才，改变我们信息技术教育几乎被国外计算机垄断的现状，力争达到使用国产计算机在教育主场中三分天下占其一的目标。', 'https://ssl.cdn.maodouketang.com/Fr-nuzSifeQnmtAF9rOzUHcX2nda', NULL, NULL, NULL, NULL, NULL, '培养“造”计算机的人才', 'https://ssl.cdn.maodouketang.com/FsELfTn2KhwjVxKpABQGhyoR-IbH', NULL, NULL);

